class Solution:
    def __init__(self):
        self.memo={}
    def solveHelper(self,A,i):
        if i==len(A)-1:
            return True
        elif (i>=len(A)) or (A[i]==0):
            return False
        else:
            for j in range(1,A[i]+1):
                step=self.solveHelper(A,j+i)
                if step==False:
                    continue
                return step
    def canJump(self,A):
        out= self.solveHelper(A,0)
        print (out)
        if out==True:
            return 1
        elif out==None or out==False:
            return 0


